    true,nt"url": null,nt"notes": "This is a line data set representing Boise
    Parks and Recreation trail data based on the National Parks and Recreation Association
    (NRPA) GIS Data Model. A trail is a pathway for public use across parks, reserves,
    or other lands. Trails can be for walking, hiking, biking or motorized use or any
    combination use. Trails can be hard surface or natural material. The trails identified
    in this data set are the trails specifically maintained by Boise Parks and Recreation.
    The features included in this line feature class are the Greenbelt trails, Federal
    Way trails, proposed greenbelt trails, Foothills and Ridge to Rivers trails. This
    data set was created from a combination of Boise Parks and Recreation park and facility
    files and the Ridge to Rivers data. This dataset was created by POWER Engineer's,
    Inc. and will be maintained by the City of Boise. This data set is updated at the
    request of Boise Parks and Recreation staff, as changes to the park data occur.
    It is current to the date it was published.",nt"license_title": "Other License
